import React from "react";
import { Link } from "react-router-dom";

export default function Header() {
  return (
    <div>
      <header>
        <Link to="/" href="#" className="logo">
          MYBLOG
        </Link>
        <nav>
          <Link to="login">Login</Link>
          <Link to="register">Register</Link>
        </nav>
      </header>
    </div>
  );
}
